    Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer and other instruments
    from Trans Future 5 in the Bass Strait, Coral Sea and others from 2006-06-27 to
    2006-12-09 (NCEI Accession 0144357)",nt"tracking_summary": {ntt"total":
