    [],nt"revision_timestamp": "2016-03-07T18:33:14.854330",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf2afdd",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144357 includes Surface
    underway data collected from Trans Future 5 in the Bass Strait, Coral Sea, North
    Pacific Ocean, Philippine Sea, Solomon Sea, South Pacific Ocean and Tasman Sea from
    2006-06-27 to 2006-12-09. These data include ABSOLUTE HUMIDITY, AIR TEMPERATURE,
    AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC
    PRESSURE, INCOMING SOLAR RADIATION, Partial pressure (or fugacity) of carbon dioxide
    - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY,
    SEA SURFACE TEMPERATURE and WIND SPEED. The instruments used to collect these data
    include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower head
    chamber equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.nnThese
    data were collected by Yukihiro Nojiri of National Institute for Environmental Studies
    as part of the VOS_Trans_Future_5_2006 data set. CDIAC associated the following
    cruise ID(s) with this data set: PAT520060627nnThe Global Volunteer Observing Ship
    (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
    Project (IOCCP). International groups from 14 countries have been outfitting research
    ships and commercial vessels with automated CO2 sampling equipment to analyze the
    carbon exchange between the ocean and atmosphere.",nt"license_title": null,nt"extras":
